import "./post.css";

const Post = () => {
  return (
    <div className="post">
      <div className="postWrapper">
        <div className="postTop">
          <img src="/assets/person/1.jpeg" alt="" className="profileImage" />
          <p className="postInfo">Joanna Doe is at New York</p>
        </div>
        <div className="postMain">
          <p className="postText"></p>
          <div className="postImage"></div>
        </div>

        <div className="postBottom"></div>
      </div>
    </div>
  );
};

export default Post;
